import React, { Component } from 'react';
import Defaultcss from './style.css';
//import './gamesession.css';

export default class logindiv extends Component {
  render() {
    return (
     <div>
        <div className="teacherStudentCircles">
            <div className="teacherDiv">
			<a className="routing" href="teacherlogin.html">
				<button className="buttonTeacher indexButton"></button>
                <div className="textUnderIndexButton">Teacher</div>
			</a>
            </div>
        </div>

        <div className="teacherStudentCircles">
            <div className="studentDiv">
			<a class="routing" href="studentlogin.html">
				<button class="buttonStudent indexButton"></button>
                <div class="textUnderIndexButton">Student</div>
			</a>
            </div>
        </div>
    </div>
    )
  }
}
